description:
Frustrated by endless searches for features on the Microsoft Office 2007 ribbon? Download and install this software to bring back the familiar menus and toolbars. The classic view allows you to work with Office 2007 as if it were Office 2003. It not only includes Classic Menu for  Word,  Excel and  PowerPoint 2007, but also includes Classic Menu for  Access and  Outlook 2007.
